import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';
import ListSubheader from '@mui/material/ListSubheader';
import IconButton from '@mui/material/IconButton';
import InfoIcon from '@mui/icons-material/Info';
import PropTypes from 'prop-types';

const avilableSizes = [150, 300, 450, 600];

function TitlebarImageList({ itemData }) {
  const selectedItemData = itemData.slice(0,100);
  selectedItemData.array.forEach(element => {
    element.url = element.url.split('/').join();
  });

  return (
    <ImageList sx={{ width: 1000, height: 500 }}>
      <ImageListItem key="Subheader" cols={2}>
        <ListSubheader component="div">Aqua Gallery</ListSubheader>
      </ImageListItem>
      {selectedItemData.map((item) => (
        <ImageListItem key={item.thumbnailUrl} cols={item.cols || 1} rows={item.rows || 1}>
          <img
            src={`${item.thumbnailUrl}?w=248&fit=crop&auto=format`}
            srcSet={`${item.thumbnailUrl}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={item.title}
            loading="lazy"
          />
          <ImageListItemBar
            title={item.title}
            actionIcon={
              <IconButton
                sx={{ color: 'rgba(255, 255, 255, 0.54)' }}
                aria-label={`info about ${item.title}`}
              >
                <InfoIcon />
              </IconButton>
            }
          />
        </ImageListItem>
      ))}
    </ImageList>
  );
}

TitlebarImageList.propTypes = {
  itemData: PropTypes.array,
  };

export default TitlebarImageList;

